package com.william.leetcode.medium;

import java.util.HashMap;
import java.util.Map;

public class Quest242 {

    public static void main(String[] args) {
        Quest242 quest242 = new Quest242();

        String s = "";
        String t = "";

        System.out.println(quest242.isAnagram(s, t));
    }

    public boolean isAnagram(String s, String t) {

        if(s.length() != t.length()){
            return false;
        }

        boolean ans = true;

        Map<Character, Integer> mapS = new HashMap<>();
        Map<Character, Integer> mapT = new HashMap<>();

        for(int i = 0; i < s.length(); i ++){
            if(mapS.get(s.charAt(i)) == null){
                mapS.put(s.charAt(i), 1);
            }else{
                mapS.put(s.charAt(i), mapS.get(s.charAt(i))+1);
            }

            if(mapT.get(t.charAt(i)) == null){
                mapT.put(t.charAt(i), 1);
            }else{
                mapT.put(t.charAt(i), mapT.get(t.charAt(i))+1);
            }
        }

        if(mapS.entrySet().size() != mapT.entrySet().size()){
            return false;
        }else{
            for(Map.Entry<Character, Integer> entry : mapS.entrySet()){
                System.out.println("key: "+entry.getKey());
                System.out.println("value S: "+mapS.get(entry.getKey()));
                System.out.println("value T: "+mapT.get(entry.getKey()));
                if(!mapS.get(entry.getKey()).equals(mapT.get(entry.getKey()))){
                    return false;
                }
            }
        }

        return ans;
    }

}
